body:
Ok - I have a fix, at least for the cases I could work up.  I am just cleaning it up since I did a lot of gross things while experimenting.

At this point, the processors can handle:

```
@Module(injects=NotYetGenerated.class)
class FooModule { }
```

and

```
@Module(library = true)
class FooModule {
  @Provides Foo provideFoo(NotYetGeneratedFooImpl impl) {
    return impl;
  }
}
```

And.

```
@Module(library = true)
class FooModule {
  @Provides NotYetGenerated provideIt() {
    return new NotYetGenerated()
  }
}
```

It even can handle _some_ generics, specifically

```
@Module(library = true)
class FooModule {
  @Provides Foo provideFoo(FooImpl<String> impl) {
    return impl;
  }
}
```

but not

```
@Module(library = true)
class FooModule {
  @Provides FooImpl<String> provideIt() {
    return new FooImpl<String>()
  }
}
```

In the former cases, the Error nodes returned contain enough type information in text to pull out in order to generate the correct things.  In the last case (returning a Generic type) the Error nodes from the compiler contain, and I kid you not, a toString() of "<any>".  That string literal specifically.  There's just no type information, not even type name information, in the error nodes if you are returning.  So I have a "failure test" to illustrate this.  Obviously this affects only cases where someone is, say, generating a type with generics that they are using in an `@Provides` method.  If someone needs this, they'll have to generate it in a separate javac process, i.e. a different maven project consumed by the `@Module` library in question.  This shouldn't affect JIT binding, since Dagger doesn't support JIT binding of generic types.

Yeah.  So this works:

```
import somePackage.Foo;
@Module(library = true)
class FooModule {
  @Provides Foo provideIt(somePackage.FooImpl impl) {
    return impl;
  }
}
```

but this does not:

```
import somePackage.Foo;
import somePackage.FooImpl;
@Module(library = true)
class FooModule {
  @Provides Foo provideIt(FooImpl impl) {
    return impl;
  }
}
```

basically the Error node contains the raw text of the type as described at the site itself, and does no attempt to lookup the import statements and pass the package information.  This will restrict the usefulness of "upstream" code generators within the same javac process, but at least generators can work.  But they have to generate really annoying code by using fully qualified class names.
